import './index.css'
import './logo.png'

const LandingPage = () => {
    return(
        <>
            <header>
                <img src="" alt="pizzaria-logo"></img>
                <h1 className='title'>Pizzaria Hohmem</h1>
            </header>
        </>
    )
}

export default LandingPage;
